import "./Settings.css";

import Checkbox from "./Checkbox";

function Settings() {
    return(
        <div className="settings__container">
            <div>
                <h1>Varsler</h1>
                <hr></hr>
                

                <Checkbox id="5" title="appmelding"></Checkbox>
            </div>
        </div>
    )
}

export default Settings;
